import React from "react";
import ReactDOM from "react-dom";
import Card from "./App";
import Sdata from "./Div";
//simport Sdata from "./Div";
//import "./index.css";


let con="netflix";
function newarr(con){
     return  
       <Card key={con.id}
         imgsrc={con.imgscr}
         title={con.title}
         sname={con.sname}
         link={con.link}
/>

  }
  ReactDOM.render(
    <>
    {Sdata.map(function(con){})} 
    <newarr />
    </>,
  document.getElementById("root") 
  );
